import React, { useEffect, useState } from "react";
import { currenciesPerPage } from "../../API/api";
import CoinBlock from "./coinElement";

const CoinElementContainer = () => {
    //debugger
  const [coins, setCoins] = useState([]);
  const [totalCoins, setTotalCoins] = useState(undefined)

  useEffect(() => {
    return currenciesPerPage().then((res) => {
        setCoins(res.data)
    })
    .catch(error => {
        console.log(error)
    });
  }, [0]);

  console.log(coins.length)

  const CoinBlockElem = coins.map(el => <CoinBlock name={el.name} img={el.logo_url} 
                                        price={el.price} price_change_prc={el['1d'].price_change_pct}
                                        market_cap={el.market_cap}/>)
  return <div>
      {CoinBlockElem}
  </div>;
};

export default CoinElementContainer;
